import React from "react";

class Cart extends React.Component {

  render() {

		var tab = JSON.parse(localStorage.getItem('Products'));

	if (tab === undefined) {
			return <div></div>
	}
		else {


		    return (
      <div class="container">
				{tab.map(product=> (
					<div>
							{product.title}
							{product.description}
							{product.description}
					</div>
				))}

      </div>
    );
	}
}
}
export default Cart;
